import img from '../../public/images/moon.jpg'
class App extends Component{



    render(){
    return(
        <div className='ui container'style={{marginTop:'20px'}}>
            <Nav />
            <br />
            <Card />
            <div className='row'>
            <Jumbotron />
            </div>
        </div>

    )
}
}

export default App;
